(2, 'Â¿QuÃ© hay que tener en cuenta para crear un sitio web?', '<div>Es importante que tengamos en mente <b>cÃ³mo se comportan los usuarios en internet a la hora de diseÃ±ar sitios web.</b> De esta forma conseguiremos que le saquen el mÃ¡ximo partido posible al sitio. Veamos cuÃ¡les son los patrones bÃ¡sicos y fundamentales de comportamiento de los usuarios en la web:</div><div><ul><li><b>Los usuarios aprecian la calidad y la credibilidad.&nbsp;</b><br></li></ul></div><div>Esto quiere decir que si ven un sitio con contenido de calidad van a perdonar la presencia de publicidad y/o un diseÃ±o pobre. Este es el motivo por el que sitios web no tan bien diseÃ±ados pero con contenido de alta calidad ganan mucho trÃ¡fico con los aÃ±os.&nbsp;</div><div><ul><li><b>Los usuarios no leen,<i> escanean</i>.</b><br></li></ul></div><div>&nbsp;Cuando miran una pÃ¡gina web, los internautas buscan puntos de referencia que les sirvan de guÃ­a en su recorrido por el contenido de la pÃ¡gina, por esta razÃ³n cuidamos organizar bien el contenido para que se asimile bien.</div><div><ul><li><b>Los usuarios web son impacientes.&nbsp;</b><br></li></ul></div><div>Cuanto menos intuitiva sea la navegaciÃ³n y mÃ¡s le cueste a un usuario obtener lo que busca, hay mas posibilidades de que abandone nuestro sitio en busca de otra opciÃ³n mejor. Basados en esto los usuarios de los sitios de Web Solutions pueden acceder sin ningÃºn problema y encuentran rÃ¡pido lo que buscan.</div><div><ul><li><b>Los usuarios no siempre eligen la mejor opciÃ³n.</b>&nbsp;<br></li></ul></div><div>Los usuarios no siempre buscan la forma mÃ¡s rÃ¡pida de encontrar la informaciÃ³n, en vez de eso, escanean la pÃ¡gina de una forma lineal, yendo secuencialmente de una secciÃ³n a otra y en cuanto encuentran un enlace que parece llevarles a lo que buscan lo clickean inmediatamente. hay que tener cuidado en poner encabezados claros.</div><div><ul><li><b>Los usuarios siguen su intuiciÃ³n.&nbsp;</b><br></li></ul></div><div>En la mayorÃ­a de los casos los usuarios seguirÃ¡n su instinto para moverse en el sitio web antes que leer la informaciÃ³n que se les ofrece. AsÃ­ que mejor presentemos la informaciÃ³n en el sitio web de forma que las cosas hagan y digan lo que se espera de ellas.</div><div><ul><li><b>Los usuarios quieren tener el control.&nbsp;</b><br></li></ul></div><div>Los usuarios quieren ser capaces de controlar su navegador y delegar en el sitio web la presentaciÃ³n de la informaciÃ³n. Por ejemplo, no quieren ventanas popups inesperadas y quieren que el botÃ³n â€œBackâ€ siempre los lleve a la pÃ¡gina anterior.</div><div>Web Solutions cuida todos estos detalles, pero para asegurarnos de que se ha considerado todo, durante el periodo de revisiÃ³n procuramos que personas no involucradas directamente con el desarrollo del proyecto naveguen por sÃ­ mismos y nos den su opiniÃ³n de quÃ© como sintieron la navegaciÃ³n del sitio.</div>', , 'image/jpeg');
INSERT INTO `noticias` (`id_noticia`, `titulo_noticia`, `descripcion_noticia`, `imagen_noticia`, `extension_noticia`) VALUES
(3, 'Â¿Por quÃ© un sitio web es de vital importancia para las PYMES?', '						<div>La presencia en lÃ­nea es vital para una pequeÃ±a empresa ya que es un campo muy competitivo, donde las empresas que ya cuentan con un sitio web estÃ¡n abarcando mercados potenciales. Seguramente hay muchas empresas que ya tienen en mente hacer su pÃ¡gina pero la mayorÃ­a no sabe cÃ³mo puede iniciar el proceso sin tener que gastar en exceso. AquÃ­ te damos 4 puntos que debes tomar en cuenta a la hora de elegir cÃ³mo configurar tu sitio web:</div><div><br></div><div><b>Competir</b>, hoy en dÃ­a el marketing digital esta posicionado como uno de los elementos mÃ¡s importante para vender mÃ¡s.</div><div>Posicionar tu marca poniendola al alcance de los clientes potenciales que buscan productos y servicios en internet.</div><div><b>Contenido dinÃ¡mico</b>, un sitio web dinÃ¡mico y al dÃ­a resulta mÃ¡s atractivo para los usuarios y a la vez les darÃ¡ una razÃ³n para volver. Herramientas de gestiÃ³n de clientes como una lista de contactos de clientes, marketing por correo electrÃ³nico, formularios de consulta personalizada- mejorarÃ¡n significativamente la atenciÃ³n a sus clientes.</div><div><b>DiseÃ±o profesional,</b> las primeras impresiones cuentan y un sitio web diseÃ±ado profesionalmente con imÃ¡genes e informaciÃ³n atractiva marca la diferencia.</div><div><b>Visibilidad</b>, debe hacer visible su sitio web, que cada vez mÃ¡s personas lo visiten y la manera de hacer esto es impulsar los motores de bÃºsqueda para que aparezca en los principales buscadores como Google.</div><div>Todo esto da como resultado final atraer a visitantes a su pÃ¡gina y convertirlos en clientes de pago y por lo tanto usted estarÃ­a cumpliendo con sus objetivos. ContÃ¡ctenos y le haremos un plan a la medida con todos estos servicios; no pierda la oportunidad de crecer.</div>					', , 'image/jpeg');
