(4, 'Â¿QuÃ© es el SEO y por quÃ© lo necesito?', '<div><i>Â¿CuÃ¡l Ã©s el mejor mÃ©todo de atraer trÃ¡fico?</i><br></div><div>La respuesta es simple:<b> Los motores de bÃºsqueda</b>. El SEO es el posicionamiento en buscadores u optimizaciÃ³n de motores de bÃºsqueda, es el proceso de mejorar la visibilidad de un sitio web en los resultados orgÃ¡nicos de los diferentes buscadores. TambiÃ©n es frecuente nombrarlo por su tÃ­tulo inglÃ©s, <b>SEO (Search Engine Optimization).</b></div><div>El SEO es una de las â€œdisciplinasâ€ que mÃ¡s ha cambiado en los Ãºltimos aÃ±os. Ahora con el SEO se persigue lo que el propio Matt Cutts califica como â€œ<i>Search Experience Optimization</i>â€ o lo que es lo mismo, â€œtodo por el usuarioâ€.</div><div>Aunque existen miles de factores en los que un motor de bÃºsqueda se basa para posicionar una pÃ¡gina u otra se podrÃ­a decir que hay dos factores bÃ¡sicos: la autoridad y la relevancia.</div><div>La autoridad es bÃ¡sicamente la popularidad de una web. Cuanto mÃ¡s popular sea mÃ¡s valiosa es la informaciÃ³n que contiene. Este factor es el que un motor de bÃºsqueda tiene mÃ¡s en cuenta dado que se basa en la propia experiencia del usuario. Cuanto mÃ¡s se comparta un contenido es que a mÃ¡s usuarios les ha parecido Ãºtil.</div><div>La relevancia es la relaciÃ³n que tiene una pÃ¡gina frente a una bÃºsqueda dada. Esto no es simplemente que una pÃ¡gina contenga un montÃ³n de veces el tÃ©rmino buscado (en los comienzos era asÃ­) si no que un motor de bÃºsqueda se basa en cientos de factores on-site para determinar esto.&nbsp;</div>', , 'image/jpeg');
INSERT INTO `noticias` (`id_noticia`, `titulo_noticia`, `descripcion_noticia`, `imagen_noticia`, `extension_noticia`) VALUES
(5, 'Â¿Te has preguntado si tu pÃ¡gina web necesita un refresh?', '<div>El sitio web de la empresa juega un papel muy importante para la presencia digital de cualquier marca. Por eso es crucial mantenerlo actualizado, sobre todo en estos tiempos donde el pÃºblico y las tendencias cambian de manera continua.</div><div>QuizÃ¡s realizaste una actualizaciÃ³n del sitio web de tu empresa hace sÃ³lo un par de aÃ±os y te estÃ©s preguntando si necesitas hacer alguna modificaciÃ³n o no. Revisa las situaciones que plantearemos a lo largo de este artÃ­culo y descubre si necesitas un refresh pÃ¡gina web.</div><div><ul><li><b>Tu empresa ha tenido ciertos cambios</b><br></li></ul></div><div>Tal vez hayas actualizado el logo de tu empresa o la paleta de colores de la imagen corporativa haya sufrido ciertas modificaciones. O es posible que hayas lanzado nuevos productos o servicios y tu catÃ¡logo anterior haya quedado obsoleto. TambiÃ©n puede ser que el equipo de trabajo se haya renovado, que tengas una nueva oficina o que los datos de contacto sean diferentes de los que aparecen en tu sitio web.</div><div>En cualquiera de estos casos, es muy importante realizar un refresh pÃ¡gina web para que los cambios formen parte de tu presencia digital Â¿Por quÃ©? La respuesta es muy simple: cuando navegamos a travÃ©s de un sitio web y descubrimos informaciÃ³n que no estÃ¡ actualizada, nos llevamos una mala impresiÃ³n de la marca.</div><div><ul><li><b>Tu sitio web es demasiado lento</b><br></li></ul></div><div>Actualmente los usuarios quieren que las pÃ¡ginas que visitan carguen rÃ¡pidamente. Estamos acostumbrados a obtener informaciÃ³n a velocidades cada vez mayores y ten por seguro que la mayorÃ­a abandonarÃ¡ tu sitio web si Ã©ste no es visible en 3 segundos o menos.</div><div>Un sitio lento puede daÃ±ar la reputaciÃ³n de tu empresa y, si este es tu caso, es tiempo de optimizar o tener un nuevo sitio web que sea mÃ¡s veloz y Ã¡gil. Si tu sitio no carga, los internautas jamÃ¡s van a explorarlo y la visibilidad de tu marca serÃ¡ casi nula.</div><div><ul><li><b>El posicionamiento SEO es deficiente</b><br></li></ul></div><div>Los sitios web deben estar diseÃ±ados de tal manera que puedan ser localizados por los buscadores. Los tÃ­tulos, palabras clave, etiquetas y metadescripciones de videos, imÃ¡genes, artÃ­culos y demÃ¡s contenidos, necesitan cumplir con ciertos requerimientos para aparecer en la bÃºsqueda que realizan los usuarios. Los textos deben tener una extensiÃ³n determinada para que los buscadores los identifiquen, asÃ­ como incluir frases cortas y sencillas.</div><div><ul><li><b>Tu sitio no tiene diseÃ±o responsive</b><br></li></ul></div><div>Â¿CÃ³mo se ve tu sitio desde tu telÃ©fono inteligente? Hasta hace unos aÃ±os la mayorÃ­a de las visitas online ocurrÃ­an desde un computador y el diseÃ±o se hacÃ­a conforme a este formato, pero en los Ãºltimos aÃ±os, es cada vez mÃ¡s frecuente que los usuarios accedan a sitios web desde sus tablets y telÃ©fonos celulares.</div><div>Si al acceder a tu sitio web desde un telÃ©fono u otra pantalla pequeÃ±a se ve como una versiÃ³n miniatura de tu pÃ¡gina que es incÃ³modo para navegar y difÃ­cil o imposible de leer, entonces es urgente actualizar diseÃ±o web responsive para que se adapte a cualquier dispositivo.</div><div><ul><li><b>El diseÃ±o es anticuado y poco amigable para navegar</b><br></li></ul></div><div>Cuando revisas tus mÃ©tricas y descubres que la tasa de usuarios que huyen del sitio web a los pocos segundos de haber ingresado es alta, significa que necesitas actualizar diseÃ±o web. El diseÃ±o debe estar pensado para mejorar la experiencia del usuario y debe facilitar la navegaciÃ³n a travÃ©s del sitio: recuerda que no debe tomarte mÃ¡s de 3 clics para llegar a cualquier destino dentro del sitio web.</div><div><ul><li><b>Tienes contenidos viejos o poco interesantes</b><br></li></ul></div><div>Cuando se registra poco trÃ¡fico en la web, puede ser porque tus contenidos son demasiado antiguos. Es muy decepcionante entrar en un sitio y descubrir que no hay ninguna novedad desde hace meses.</div><div>Si actualizas continuamente el sitio pero aÃºn asÃ­ se registra poco trÃ¡fico, puede que los contenidos no estÃ©n llegando al pÃºblico deseado. Es importante hacer una segmentaciÃ³n de tus posibles lectores y crear contenidos que sean interesantes para ellos. Un contenido exitoso atraerÃ¡ trÃ¡fico al nuevo sitio web y ademÃ¡s podrÃ¡ viralizarse en las redes sociales, lo que se traduce en una mayor presencia de marca y mÃ¡s posibilidades de obtener conversiones y leads.</div><div><br></div><div>Si te identificas con una o mÃ¡s de estas afirmaciones, significa que tu pÃ¡gina necesita un refresh y deberÃ¡s invertir en tu diseÃ±o web. No olvides tomar en cuenta la retroalimentaciÃ³n de los usuarios y poner especial Ã©nfasis a los comentarios negativos, por ejemplo, si uno o mÃ¡s usuarios hacen un llamado de atenciÃ³n sobre la lentitud o dificultad para navegar en el sitio, significa que algo no estÃ¡ funcionando y deberÃ¡s hacer los cambios pertinentes para mejorar la experiencia del cliente.</div><div><br></div>', , 'image/jpeg');
INSERT INTO `noticias` (`id_noticia`, `titulo_noticia`, `descripcion_noticia`, `imagen_noticia`, `extension_noticia`) VALUES
(6, 'Â¿QuÃ© es y para que sirve el Responsive Design?', '<div>El <b>Responsive Design</b> o<b> diseÃ±o adaptativo,</b> es la tÃ©cnica que se usa en la actualidad para tener una misma web adaptada a las diferentes plataformas que nos brinda la tecnologÃ­a: ordenador, tablet y Smartphone.</div><div>Consiste en una serie de hojas de estilo en CSS3, que usando el atributo â€œmediaqueryâ€ convierten una web ordinaria en una web multi-plataforma capaz de adaptarse a todos los tamaÃ±os que existen, ofreciendo una experiencia para el usuario mucho mÃ¡s amena y cubriendo las necesidades de nuestro pÃºblico. AtrÃ¡s quedan las webs que vistas en un Smartphone se tenÃ­an que ampliar para poder leer algo.</div><div><b><br></b></div><div><i><b>Â¿Por quÃ© tu web deberÃ­a ser Responsive?</b></i></div><div><i><b><br></b></i></div><div>Las ventajas del Responsive Design son muchas y leyendo cuales son, seguro que te convences para convertir tu web en una web multiplataforma:</div><div><ul><li><b>Mejor experiencia de usuario.&nbsp;</b><br></li></ul></div><div>Eso repercute en la opiniÃ³n que los usuarios tienen de tu sitio web y el uso que le darÃ¡n a ella. MejorarÃ¡ tanto tu imagen de marca como el tiempo de permanencia en la web y aumentarÃ¡ la tasa de rebote entre pÃ¡ginas de tu web.<br></div><div><ul><li><b>Se acabaron los contenidos duplicados.</b><br></li></ul></div><div>&nbsp;Si usabas una versiÃ³n mÃ³vil para que los usuarios que accedÃ­an a tu web vieran el contenido adaptado al dispositivo, era perjudicial para tu SEO, ya que eso creaba contenido duplicado y por lo tanto Google penalizaba a tu web. Un diseÃ±o Responsive evita este problema ya que es el mismo contenido que se organiza de manera distinta segÃºn el dispositivo en el que se vea.</div><div><ul><li><b>Se reducen los costes de desarrollo y mantenimiento de la web.</b><br></li></ul></div><div>&nbsp;Al usar la misma plantilla para todas las plataformas, se reduce la inversiÃ³n en mantenimiento y desarrollo, ya que un sÃ³lo cambio repercute en todas las versiones.</div><div><ul><li><b>Aumenta la viralidad</b>.&nbsp;<br></li></ul></div><div>Un reciente estudio certifica que el 70% de los accesos a las redes sociales se hacen a travÃ©s de dispositivos mÃ³viles, eso significa que si un usuario accede a nuestra web a travÃ©s de un Smartphone, seguramente tenga las aplicaciones sociales abiertas y si quiere compartir algo, es mucho mÃ¡s rÃ¡pido y natural.</div>', , 'image/png');
INSERT INTO `noticias` (`id_noticia`, `titulo_noticia`, `descripcion_noticia`, `imagen_noticia`, `extension_noticia`) VALUES
(7, '7 Factores a tener en cuenta para adquirir un dominio y un hosting', '<div>Hoy en dÃ­a, para cualquier empresa, tener un sitio web es prÃ¡cticamente obligatorio y aunque el uso que le de cada compaÃ±Ã­a puede variar, aprovechando en mayor o menor medida las herramientas que hoy ofrece el mundo digital, hay ciertos aspectos bÃ¡sicos, sobre el dominio y el hospedaje o hosting, que se deben tomar en cuenta si queremos que el desempeÃ±o de nuestro sitio sea el deseado.</div><div><br></div><div><i><b>Â¿QuÃ© es un dominio y quÃ© es un hosting? </b></i>AquÃ­ lo explicamos brevemente:</div><div><br></div><div><b>Dominio:</b></div><div><br></div><div>Un dominio o nombre de dominio es el nombre que identifica un sitio web. Cada dominio tiene que ser Ãºnico en Internet. Un dominio se basa en extensiones ( .com, .net, .org, etc)</div><div><b><br></b></div><div><b>Hosting:</b></div><div><br></div><div>El hosting u hospedaje web consiste en alquilar un espacio en una computadora, de manera que cuando alguien en Internet envÃ­e un correo a alguna direcciÃ³n que termine en @suempresa.com, o cuando alguien visite www.suempresa.com, esta computadora serÃ­a la encargada de recibir ese correo y almacenarlo, o bien, de responder al llamado de www.suempresa.com y permitir que un visitante de su sitio web pueda verlo y tener acceso a la informaciÃ³n.</div><div><br></div><div>Veamos los siete aspectos que debemos tener en cuenta a la hora de elegir un dominio y un hosting.</div><div><br></div><div><ul><li><b>Que la extensiÃ³n sea conocida:</b><br></li></ul></div><div><br></div><div>Muchos usuarios no estÃ¡n informados de que existe una gran diversidad de extensiones y les puede sonar raro, o pueden interpretar como una pÃ¡gina falsa si ven que tiene una extensiÃ³n diferente o poco usual. Por ende usar un .com .co.cr da mucha mÃ¡s credibilidad a la empresa.</div><div><br></div><div><ul><li><b>Que el dominio sea corto:</b><br></li></ul></div><div><br></div><div>LÃ³gicamente, si un dominio es muy largo puede prestarse para confusiones o errores al escribirlo, no se va a recordar bien y sobre todo en mÃ³viles, va a ser mucho mÃ¡s difÃ­cil de ingresar en el buscador.</div><div><br></div><div><ul><li><b>Buscar siempre alternativas:&nbsp;&nbsp;</b><br></li></ul></div><div><br></div><div>Â¡No hay que quedarse con la primer idea! Al buscar diferentes alternativas u opciones de dominio que tengan que ver con el nombre de nuestra empresa, puede surgir un dominio mÃ¡s interesante y recordable.</div><div><br></div><div><ul><li><b>Comprar el hospedaje web indicado:</b><br></li></ul></div><div><br></div><div>Es muy importante para una empresa elegir un hospedaje que soporte correos electrÃ³nicos, el servicio bÃ¡sico no siempre incluye la creaciÃ³n de correos y luego nos podemos ver limitados. Al contratar un servicio de hospedaje econÃ³mico que incluya los correos, tenemos la ventaja de no incurrir en gastos adicionales mÃ¡s adelante.</div><div><br></div><div><ul><li><b>Conocer el espacio del hospedaje web:</b><br></li></ul></div><div><br></div><div>Si necesitÃ¡ramos hacer un backup de correos y subir el sitio debemos tomar en cuenta que nos podemos quedar cortos de espacio, por lo que es preciso elegir un hospedaje web de acuerdo a las caracterÃ­sticas de cada negocio.</div><div><br></div><div><ul><li><b>Saber el nÃºmero de visitantes al sitio:</b><br></li></ul></div><div><br></div><div>Â¡Es mejor no llevarse sorpresas! Si se contrata un plan bÃ¡sico y el sitio web es muy visitado, puede que el servidor no tenga los recursos necesarios y el sitio no pueda responder adecuadamente en los momentos mÃ¡s importantes.</div><div><br></div><div><ul><li><b>Requerimientos o caracterÃ­sticas tÃ©cnicas del servidor:</b><br></li></ul></div><div><br></div><div>Si la empresa es grande es probable que requiera un servidor premium que tenga la capacidad de recibir muchas visitas y responder adecuadamente a los procesamientos de bases de datos. Si se trata de una microempresa por ejemplo, puede optar por un servicio mÃ¡s bÃ¡sico.&nbsp; TambiÃ©n depende de la plataforma en la que estÃ© instalado el sitio, que va a requerir mÃ¡s o menos capacidad de memoria y procesador por parte del servidor.</div>', , 'image/jpeg');

